class base64 {
  static encode(u8) { if (typeof btoa !== 'undefined') return btoa(String.fromCharCode(...u8)); else return Buffer.from(u8).toString('base64'); }
  static decode(b64) { if (typeof atob !== 'undefined') return Uint8Array.from(atob(b64), c => c.charCodeAt(0)); else return Uint8Array.from(Buffer.from(b64, 'base64')); }
}


// Frame-of-Reference + bit-packing codec
// This is used to encode bunch of integers into smallest possible space
// effectively storing them as like xz compressed.
class TightInts
{
  /* -------------------------------- helpers -------------------------------- */
  static _u16(out, v) { out.push(v & 255, v >>> 8); }
  static _u32(out, v) { out.push(v & 255, v >>> 8 & 255, v >>> 16 & 255, v >>> 24 & 255); }

  /* -------------------------------- encode --------------------------------- */
  /** Encode an array of unsigned integers -> Uint8Array */
  static encode(values, blockSize = 128) {
    const out = [];

    for (let i = 0; i < values.length; i += blockSize) {
      const block = values.slice(i, i + blockSize);
      const min = Math.min(...block);
      const deltas = block.map(v => v - min);
      const maxD = Math.max(...deltas);
      const bw = maxD === 0 ? 0 : 32 - Math.clz32(maxD); // ceil(log2(maxD+1))

      this._u16(out, block.length);               // len
      this._u32(out, min >>> 0);                  // min
      out.push(bw);                               // bit-width

      if (bw === 0) continue;                     // constant block

      let curr = 0, fill = 0;
      for (const d of deltas) {
        curr |= d << fill;
        fill += bw;
        while (fill >= 8) { out.push(curr & 255); curr >>>= 8; fill -= 8; }
      }
      if (fill) out.push(curr);
    }
    return Uint8Array.from(out);
  }

  /* -------------------------------- decode --------------------------------- */
  /** Decode Uint8Array produced by `encode` back to a plain number[] */
  static decode(bytes) {
    const out = [];
    for (let pos = 0; pos < bytes.length; ) {
      const len = bytes[pos] | (bytes[pos + 1] << 8); pos += 2;
      const min = bytes[pos] | (bytes[pos + 1] << 8) |
                  (bytes[pos + 2] << 16) | (bytes[pos + 3] << 24); pos += 4;
      const bw = bytes[pos++];

      if (bw === 0) { out.push(...Array(len).fill(min >>> 0)); continue; }

      let curr = 0, fill = 0, i = 0;
      while (i < len) {
        if (fill < bw) { curr |= bytes[pos++] << fill; fill += 8; continue; }
        out.push((curr & ((1 << bw) - 1)) + (min >>> 0));
        curr >>>= bw; fill -= bw; i++;
      }
    }
    return out;
  }
}

class varInt
{
  // Encode an array of non-negative integers as a varint byte stream
  static encode(ints)
  {
    const out = [];
    for (let n of ints) {
        if (n < 0) throw new Error('Negative values not supported');
        // emit 7 bits at a time, low-to-high
      while (n >= 0x80) {
        out.push((n & 0x7F) | 0x80);
        n >>>= 7;
      }
      out.push(n & 0x7F);
    }
    return Uint8Array.from(out);
  }

  // Decode a Uint8Array of varints into an array of integers.
  static decode(bytes)
  {
    const ints = [];
    let i = 0;
    while (i < bytes.length)
    {
      let result = 0;
      let shift = 0;
      let b;
      // read bytes until high bit = 0
      do {
        if (i >= bytes.length) {
          throw new Error('Truncated varint at offset ' + i);
        }
        b = bytes[i++];
        result |= (b & 0x7F) << shift;
        shift += 7;
      } while (b & 0x80);
      ints.push(result);
    }
    return ints;
  }
}


class BytePairEncoding {
  constructor(limit, verbose = false) {
    this.limit = limit;
    this.verbose = verbose;
    this.vocab = [];
    this.merges = [];
    this.forbidden = new Set([32,10,13]);
    this.maxTokenLen = 10;

    // initialize single-byte tokens
    for (let i = 0; i < 256; i++) this.vocab.push(Uint8Array.of(i));
  }

  // Train model on texts (array of strings)
  train(texts)
  {
    const startSize = this.vocab.length;
    const limit     = startSize + this.limit;

    if (this.verbose) console.log(`- [train] vocab limit ${this.limit}`);

    // build corpus
    const corpus = texts.map((txt, i) =>
    {
      if (this.verbose && i && i % 1000 === 0) console.log(`    - processed ${i}/${texts.length}`);

      // BPE tokens
      const arr = Uint32Array.from(this.encode(txt));

      // use Uint32Array to support large token IDs
      const seq = new Uint32Array(arr.length + 1);
      seq.set(arr, 0);
      seq[arr.length] = 0;
      return seq;
    });

    // build pair counts
    const counts = Object.create(null);
    for (const seq of corpus)
    {
      for (let i = 1; i < seq.length; i++) {
        const a = seq[i - 1], b = seq[i];
        if (!a || !b) continue;
        const key = `${a},${b}`;
        counts[key] = (counts[key] || 0) + 1;
      }
    }
    if (this.verbose) console.log(`    - ${Object.keys(counts).length} distinct pairs`);

    // merge pairs and create new vocabulary entries
    const MIN_FREQ = 2;

    while (this.vocab.length < limit) {
      // find most frequent pair
      let bestKey = null, bestFreq = 0;
      for (const key in counts)
      {
        if (counts[key] > bestFreq)
        {
          const [A, B] = key.split(',').map(Number);
          const mergedLen = this.vocab[A].length + this.vocab[B].length;
          if (mergedLen > this.maxTokenLen) continue;                 // length guard
          const bad =
            this.vocab[A].some(b => this.forbidden.has(b)) ||
            this.vocab[B].some(b => this.forbidden.has(b));
          if (bad) continue;                                          // byte-filter guard
            bestFreq = counts[key];
            bestKey  = key;
          }
      }
      if (!bestKey || bestFreq < MIN_FREQ) break;

      const [A, B] = bestKey.split(',').map(Number);
      const id = this.vocab.length;

      // add new token
      this.vocab.push( Uint8Array.from([...this.vocab[A], ...this.vocab[B]]) );
      this.merges.push([A, B, id]);

      if (this.verbose) console.log( `- [train] merge #${this.merges.length} ` + `(${A},${B}) freq=${bestFreq} - ${id}` );

      // apply merge and update counts
      for (let s = 0; s < corpus.length; s++) {
        const seq = corpus[s];
        const next = [];
        for (let i = 0; i < seq.length; i++) {
          if (seq[i] === A && seq[i+1] === B) {
            const prev = next.at(-1) || 0;
            const nxt  = seq[i+2] || 0;

            // decrement old pair counts
            const prevKey = `${prev},${A}`;
            if (prev && counts[prevKey] != null) counts[prevKey]--;
            counts[bestKey]--;
            const nextKey = `${B},${nxt}`;
            if (nxt && counts[nextKey] != null) counts[nextKey]--;

            // increment new pair counts
            const newPrevKey = `${prev},${id}`;
            if (prev) counts[newPrevKey] = (counts[newPrevKey] || 0) + 1;
            const newNextKey = `${id},${nxt}`;
            if (nxt) counts[newNextKey] = (counts[newNextKey] || 0) + 1;

            next.push(id);
            i++;
          } else next.push(seq[i]);
        }
        corpus[s] = Uint32Array.from(next);
      }
    }

    if (this.verbose) console.log(`- [train] done (vocab=${this.vocab.length})`);
  }

  encode(text)
  {
    let tokens = Array.from((new TextEncoder()).encode(text));
    tokens.push(0);
    for (const [a, b, id] of this.merges) {
      const out = [];
      for (let i = 0; i < tokens.length; i++) {
        if (tokens[i] === a && tokens[i+1] === b) {
          out.push(id);
          i++;
        } else {
          out.push(tokens[i]);
        }
      }
      tokens = out;
    }
    return tokens;
  }

  decode(tokens)
  {
    const bytes = tokens.flatMap(t => Array.from(this.vocab[t]));
    if (bytes.at(-1) === 0) bytes.pop();
    return (new TextDecoder()).decode(Uint8Array.from(bytes));
  }
}

BytePairEncoding.prototype.toBuffer = function ()
{
  // flatten every (A,B) pair into one array, then varint-encode
  const ints = new Uint32Array(this.merges.length * 2);
  this.merges.forEach(([a, b], i) => {
    ints[i * 2]     = a;
    ints[i * 2 + 1] = b;
  });
  return base64.encode(TightInts.encode(ints));
};


BytePairEncoding.fromBuffer = function (buf, limit = 100, skipVocab=false) // limit in percent of total length
{
  const mdl = new BytePairEncoding(16000, false); // the arguments actually matter only for training

  const BASE = 256;                 // fixed single-byte alphabet
  mdl.vocab.length = BASE;

  const pairs = TightInts.decode(buf);

  if (pairs.length % 2)
    throw new Error('Corrupt BPE file: odd number of ints');

  for (let i = 0; i < pairs.length; i += 2) {
    if (i >= pairs.length * limit / 100) break; // limit in percent of total length
    const a  = pairs[i];
    const b  = pairs[i + 1];
    const id = BASE + (i >> 1);     // id = 256 + merge-index
    mdl.merges.push([a, b, id]);
    mdl.vocab.push(null);           // placeholder (fill if you need decoding)
  }

  // optional: materialise byte sequences now to keep decode() fast
  if (!skipVocab)
  for (let id = BASE; id < mdl.vocab.length; id++) {
    const [a, b] = mdl.merges[id - BASE];
    mdl.vocab[id] = Uint8Array.from([
      ...mdl.vocab[a],
      ...mdl.vocab[b]
    ]);
  }
  return mdl;
};


